import React from "react";
import "./App.css";
import Aux from "../src/com/fplan/hoc/Aux";
import HomePage from "../src/com/fplan/components/generalhome/HomePage";
import SignIn from "../src/com/fplan/components/signing/SignIn";
import SignUp from "../src/com/fplan/components/signing/SignUp";
import { Route, Switch, withRouter, Redirect } from "react-router-dom";

const App = (props) => {
  let routes = (
    <Switch>
      <Route exact path="/">
        <Redirect to="/home" />
      </Route>
      <Route path="/signup" component={SignUp}></Route>
      <Route path="/signin" component={SignIn}></Route>
      <Route path="/home" component={HomePage}></Route>
    </Switch>
  );

  return (
    <Aux>
      <div className="App">{routes}</div>
    </Aux>
  );
};

export default withRouter(App);
